import React from "react";
import { useState } from "react";
import axios from "axios";
import { useEffect } from "react";
import {  BrowserRouter ,Link,Router,  Routes,  Route} from "react-router-dom";
import Candels from './Candels'
function FetchSearch()

    {   var c=-1
        const [desc,setDes]=useState([])
        const [symbl,setSym]=useState([])
        var li=[]
        var lii=[]
        
        function Inn()
        {
       
        axios
                .get(`https://finnhub.io/api/v1/search?q=aapl&token=cjmeg19r01qmdd9puljgcjmeg19r01qmdd9pulk0`)
        .then((response) =>
        {   var con=0
               const {count}= response.data
               console.log(count)
               while(con<count){
                const {description,symbol}= response.data.result[con]
                console.log(description)
                li.push(symbol)
                lii.push(description)
                setDes(lii)
                setSym(li)
                con=con+1
               }
                
        })
    }
    ;
    useEffect(() => {
        Inn()
      }, [])
        
        return(<>
        {
           desc.map((x)=>{
            c=c+1
            return <a href="/r" style={{color:"black",textDecoration:'none'}} value={symbl[c]}><h1>name:{x}, symbol:{symbl[c]}</h1></a>
           })
            
            }


<BrowserRouter>
     
      <Routes>
        
          <Route path="r" element={<Search name={symbl[c]} />} />
      </Routes>
    </BrowserRouter>
       </>)
       
    }
    export default FetchSearch
